import React from "react";
import { Routes, Route } from "react-router-dom";
import Main from "./Main";
function App() {
  return (
    <div >
      <Routes>
        <Route path="/" element={<Main/>}></Route>
      </Routes>
    </div>
  );
}
export default App;
